package com.thinkgem.jeesite.modules.thirdparty.entity;

import com.thinkgem.jeesite.common.persistence.DataEntity;

import java.util.Date;

/**
 * 期次销量Entity
 * @author Matthew
 * @version 2017-09-11
 */
public class IssueSale extends DataEntity<IssueSale> {
  private Long recId;
  private Long userId;
  private Long billMan;
  private Long lotId; //彩种编号
  private String lotName; //彩种
  private Long lotIssue;//期次编号
  private Long endDate;
  private Long succProjCount; //
  private Long totalSell;//销售金额
  private Long totalFail;//
  private String totalBonus;//返奖金额
  private String totalRealbonus;//税后金额
  private String totalFailBonus;
  private Long statAdmin;
  private Date statTime;

  public String getLotName() {
    return lotName;
  }

  public void setLotName(String lotName) {
    this.lotName = lotName;
  }

  public Long getRecId() {
    return recId;
  }

  public void setRecId(Long recId) {
    this.recId = recId;
  }

  public Long getUserId() {
    return userId;
  }

  public void setUserId(Long userId) {
    this.userId = userId;
  }

  public Long getBillMan() {
    return billMan;
  }

  public void setBillMan(Long billMan) {
    this.billMan = billMan;
  }

  public Long getLotId() {
    return lotId;
  }

  public void setLotId(Long lotId) {
    this.lotId = lotId;
  }

  public Long getLotIssue() {
    return lotIssue;
  }

  public void setLotIssue(Long lotIssue) {
    this.lotIssue = lotIssue;
  }

  public Long getEndDate() {
    return endDate;
  }

  public void setEndDate(Long endDate) {
    this.endDate = endDate;
  }

  public Long getSuccProjCount() {
    return succProjCount;
  }

  public void setSuccProjCount(Long succProjCount) {
    this.succProjCount = succProjCount;
  }

  public Long getTotalSell() {
    return totalSell;
  }

  public void setTotalSell(Long totalSell) {
    this.totalSell = totalSell;
  }

  public Long getTotalFail() {
    return totalFail;
  }

  public void setTotalFail(Long totalFail) {
    this.totalFail = totalFail;
  }

  public String getTotalBonus() {
    return totalBonus;
  }

  public void setTotalBonus(String totalBonus) {
    this.totalBonus = totalBonus;
  }

  public String getTotalRealbonus() {
    return totalRealbonus;
  }

  public void setTotalRealbonus(String totalRealbonus) {
    this.totalRealbonus = totalRealbonus;
  }

  public String getTotalFailBonus() {
    return totalFailBonus;
  }

  public void setTotalFailBonus(String totalFailBonus) {
    this.totalFailBonus = totalFailBonus;
  }

  public Long getStatAdmin() {
    return statAdmin;
  }

  public void setStatAdmin(Long statAdmin) {
    this.statAdmin = statAdmin;
  }

  public Date getStatTime() {
    return statTime;
  }

  public void setStatTime(Date statTime) {
    this.statTime = statTime;
  }
}
